import React from 'react'
import { Container, Row, Col } from 'react-bootstrap';
import './home.css';
// import ClassList from './ClassList';
import Navbar from './Navbar';

const Home = () => {
  return (
    <div className='bg'>
      <Container className='custom-container'>
        <Row>
          <Col lg={7} className='text-container'>
            <h1 className='custom-text'>The Clear Path To <br /> A Brighter <br /> Tomorrow</h1>
            <p className='custom-paragraph'>
              "Selamat datang di BrightPath! Kami berkomitmen untuk menyediakan
              pengalaman belajar yang interaktif dan menyenangkan. Jelajahi berbagai
              kursus dan materi yang dirancang khusus untuk meningkatkan pengetahuan
              dan keterampilan Anda. Mari mulai perjalanan belajar Anda bersama kami
              dan capai potensi penuh Anda!"
            </p>
            <button className='btn btn-light custom-button'>Get Started</button>
          </Col>
        </Row>
        <Row>
          <div className='content'>
            <div className='card'>
              <div className='card-image-container'>
                <img src='/images/black.jpeg' alt='1'/>
              </div>
              <p className='card-category'>Design</p>
              <p className='card-name'><span>Figma UI UX Design</span></p>
              <p>Use Figma to get a job in UI Design, User Interface, User Experience design.</p>
            </div>
            <div className='card'>
              <div className='card-image-container'>
                <img src='/images/black.jpeg' alt='2'/>
              </div>
              <p className='card-category'>Design</p>
              <p><span>Learn With Shoaib</span></p>
              <p>Design Web Sites and Mobile Apps that Your Users Love and Return to Again.</p>
            </div>
            <div className='card'>
              <div className='card-image-container'>
                <img src='/images/black.jpeg' alt='3'/>
              </div>
              <p className='card-category'>Design</p>
              <p><span>Building User Interface</span></p>
              <p>Learn how to apply User Experience (UX) principles to your website designs.</p>
            </div>
          </div>
        </Row>
      </Container>
    </div>
  )
}

export default Home;
